import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './components/Header';
import MovieList from './components/MovieList';
import MovieDetail from './components/MovieDetail';
import Login from './components/Login';
import Register from './components/Register';
import Profile from './components/Profile';
import Watchlist from './components/Watchlist';
import AdminDashboard from './components/AdminDashboard';
import AdminMovieForm from './components/AdminMovieForm';
import AdminActorForm from './components/AdminActorForm';
import AdminGenreForm from './components/AdminGenreForm';
import AdminRealisateurForm from './components/AdminRealisateurForm';

function App() {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<MovieList />} />
        <Route path="/movies/:id" element={<MovieDetail />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/profile" element={<Profile />} />
        <Route path="/watchlist" element={<Watchlist />} />
        <Route path="/admin/dashboard" element={<AdminDashboard />} />
        <Route path="/admin/movies" element={<AdminMovieForm />} />
        <Route path="/admin/movies/:id/edit" element={<AdminMovieForm />} />
        <Route path="/admin/actors" element={<AdminActorForm />} />
        <Route path="/admin/actors/:id/edit" element={<AdminActorForm />} />
        <Route path="/admin/genres" element={<AdminGenreForm />} />
        <Route path="/admin/genres/:id/edit" element={<AdminGenreForm />} />
        <Route path="/admin/realisateurs" element={<AdminRealisateurForm />} />
        <Route path="/admin/realisateurs/:id/edit" element={<AdminRealisateurForm />} />
      </Routes>
    </Router>
  );
}

export default App;
